description:
Bloody Sunday skildrar den odesdigra dagen pa Nordirland den 
30 januari 1972, da brittiska soldater skot ned 13 obevapnade
demonstanter som deltog i en marsch for medborgarrattigheter
i staden Derry pa Nordirland. Det blev en vandpunkt i den moderna
irlandska konflikten och upptakten for IRA och 25 ar av vald och
terrorism...
